import Head from 'next/head'
import { useState } from 'react'
import { FriendListWrapper } from './Friends.styles'

const Friends = () => {

    
    const createFriend = (name: string, surname: string, photo: string, id: number) => {
        return (
            {
                Name: name,
                Surname: surname,
                Photo: photo,
                id: id
            }
            )
        }
        
        const [friends] = useState([createFriend('Александр', 'Иванов','')])

        const renderFriends = () => {
            return (
                <>
                <Head>
                    <title>Друзья</title>
                </Head>
                <>
                    {friends.map((friend) => (
                        <FriendListWrapper key={friend.id}>
                            <img src={friend.Photo} />
                            <h1>{`${friend.Name} ${friend.Surname}`}</h1>
                        </FriendListWrapper>
                    ))}
                </>
            </>
        )

    }
    
    return renderFriends()
}

export default Friends
